import React from "react";
import io from "socket.io-client";

function Game({ name1, name2, value }) {
  const socket = io("http://localhost:3001");

  const buttonClicked = (e) => {
    e.innerText = value;
    socket.emit("playing", {
      value: value,
      id: e.target.id,
      name: name1,
    });
  };

