    grid.remove()
    const row = Math.sqrt(grid.length);
    let count = 0;
    console.log(grid);
    for (let i = 0; i < grid.length / row; i++) {
      let rowArr = [];
      for (let j = 0; j < row; j++) {
        if (grid[i].id != "") {
          console.log(count);
          rowArr.push(document.getElementById(grid[count].id).innerText);
        }
        count++;
      }
